    // About.jsx
export function About() {
  return (
    <section className="p-8 max-w-4xl mx-auto" data-aos="fade-up">
      <h2 className="text-4xl font-bold mb-4 border-b-4 inline-block border-indigo-500">About Me</h2>
      <p className="text-lg leading-relaxed mt-4">
        I'm Laeeba Javed, a Computer Science graduate from Aligarh Muslim University with an 8.6/10 CGPA. Passionate about AI and Full Stack Development, I'm joining Universität des Saarlandes for my Master's in Computer Science. I’ve worked on impactful projects, led technical communities, and co-authored multiple publications in AI.
      </p>
    </section>
  );
}
